class UploadPanelComponent {
    constructor() {
        this.statusHeaderOpened = false;
        this.uploadProcessCompletedSuccessfully = false;
        this.closePanel = new EventEmitter();
        this.cancelUploads = new EventEmitter();
    }
    toggleStatusHeader() {
        this.statusHeaderOpened = !this.statusHeaderOpened;
    }
    get statusHeaderCSSClass() {
        return this.statusHeaderOpened ? 'up-upload-status-header' : 'up-upload-status-header-rounded';
    }
    get statusHeaderChevronIcon() {
        return this.isStatusHeaderOpened ? 'chevron_down_medium' : 'chevron_up_medium';
    }
    get isStatusHeaderOpened() {
        return this.statusHeaderOpened === true;
    }
    get isUploadProcessCompletedSuccessfully() {
        return this.uploadProcessCompletedSuccessfully === true;
    }
    handleClosePanel() {
        this.closePanel.emit();
    }
    handleCancelUploads() {
        this.cancelUploads.emit();
    }
}
